import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);



var express = require("express");
var app = express();
app.listen(3000, () => {
 console.log("Server running on port 3000");
});
